CREATE DATABASE IF NOT EXISTS work_order_pro;
USE work_order_pro;

-- work_order_status
--
DROP TABLE IF EXISTS work_order_pro.work_order_status;

-- Create Table
CREATE TABLE work_order_status
(
  work_order_status_code  CHAR(2)      NOT NULL                                                          COMMENT 'Work Order Status _code'
 ,work_order_status_desc  VARCHAR(15)  NOT NULL                                                          COMMENT 'Work Order Status _desc'
 ,date_added              DATETIME     NOT NULL  DEFAULT CURRENT_TIMESTAMP                               COMMENT 'Date Added'
 ,date_last_updated       DATETIME     NOT NULL  DEFAULT CURRENT_TIMESTAMP  ON UPDATE CURRENT_TIMESTAMP  COMMENT 'Date Last Updated'

 ,PRIMARY KEY (work_order_status_code)
)
COMMENT 'Work Order Status'
;

