-- technician_work_permit
--
DROP TABLE IF EXISTS work_order_pro.technician_work_permit;

-- Create Table
CREATE TABLE technician_work_permit
(
  technician_code           CHAR(6)  NOT NULL  COMMENT 'Technician Code'
 ,state_code                CHAR(2)  NOT NULL  COMMENT 'State Code'

 ,PRIMARY KEY (technician_code, state_code)
)
COMMENT = 'Technician Work Permit'
;

ALTER TABLE technician_work_permit
	ADD CONSTRAINT technician_work_permit_technician_fk
	FOREIGN KEY    (technician_code)
	REFERENCES     technician (technician_code)
	ON DELETE RESTRICT
	ON UPDATE RESTRICT;

ALTER TABLE technician_work_permit
	ADD CONSTRAINT technician_work_permit_state_fk
	FOREIGN KEY    (state_code)
	REFERENCES     state (state_code)
	ON DELETE RESTRICT
	ON UPDATE RESTRICT;

