-- product
--
DROP TABLE IF EXISTS work_order_pro.product;

-- Create Table
CREATE TABLE product
(
  sku_code                CHAR(6)        NOT NULL             COMMENT 'SKU Code'
 ,sku_description         VARCHAR(30)    NOT NULL             COMMENT 'SKU Description'
 ,unit_cost               DECIMAL(11,4)  NOT NULL             COMMENT 'Unit Cost'
 ,product_type_code       CHAR(1)        NOT NULL             COMMENT 'Product Type Code'
 ,universal_product_code  CHAR(12)                            COMMENT 'Universal Product Code'
 ,active                  BIT            NOT NULL  DEFAULT 1  COMMENT 'Active'

 ,PRIMARY KEY (sku_code)
)
COMMENT = 'Product'
;

ALTER TABLE product
	ADD CONSTRAINT product_product_type_fk
	FOREIGN KEY    (product_type_code)
	REFERENCES     product_type (product_type_code)
	ON DELETE RESTRICT
	ON UPDATE RESTRICT;

