-- customer
--
DROP TABLE IF EXISTS work_order_pro.customer;

-- Create Table
CREATE TABLE customer
(
  customer_id             INTEGER       NOT NULL                                                          COMMENT 'Customer ID'
 ,customer_first_name     VARCHAR(20)   NOT NULL                                                          COMMENT 'Customer First Name'
 ,customer_last_name      VARCHAR(25)   NOT NULL                                                          COMMENT 'Customer Last Name'
 ,customer_address_1      VARCHAR(50)   NOT NULL                                                          COMMENT 'Customer Address 1'
 ,customer_address_2      VARCHAR(50)   NOT NULL  DEFAULT ''                                              COMMENT 'Customer Address 2'
 ,customer_city           VARCHAR(25)   NOT NULL                                                          COMMENT 'Customer City'
 ,customer_state          CHAR(2)       NOT NULL                                                          COMMENT 'Customer State'
 ,customer_zip            CHAR(5)       NOT NULL                                                          COMMENT 'Customer Zip'
 ,customer_phone          CHAR(10)                                                                        COMMENT 'Customer Phone'
 ,customer_email_address  VARCHAR(200)                                                                    COMMENT 'Customer Email Address'
 ,date_added              DATETIME      NOT NULL  DEFAULT CURRENT_TIMESTAMP                               COMMENT 'Date Added'
 ,date_last_updated       DATETIME      NOT NULL  DEFAULT CURRENT_TIMESTAMP  ON UPDATE CURRENT_TIMESTAMP  COMMENT 'Date Last Updated'

 ,PRIMARY KEY (customer_id)
)
COMMENT = 'Customer'
;

